import React, { useState } from "react";
import "./Homepage.css";
import { Link } from "react-router-dom";
import Overview from "../components/Overview";
import Goals from "../components/Goals";
import Diet from "../components/Diet";

const components = {

}
const Homepage = () => {
  const [left_menu, setLeftMenu] = useState("Overview");
  const [selectedPage, setSelectPage] = useState(<Overview />);
  const updateMenu = (menu) => {
    setLeftMenu(menu);
    if (menu === "Overview") setSelectPage(<Overview />);
    else if (menu === "Goals") setSelectPage(<Goals />);
    else if (menu === "Diet Plan") setSelectPage(<Diet />);
  };

  return (
    <div className="homepage">
      <div className="left-menu-bar">
        <div className="fitness-home-icon">
          <h2>Fitness</h2>
          <i
            className="fa-solid fa-dumbbell"
            style={{ color: "#fb7316", fontSize: "1.5rem" }}
          />
        </div>
        <hr />
        <div className="menu-options">
          <ul>
            <li onClick={() => updateMenu("Overview")}>
              <button className={`${left_menu === "Overview" ? "active" : ""}`}>
              <i class="fa-solid fa-vector-square"></i>
                Overview
              </button>
            </li>
            <li onClick={() => updateMenu("Goals")}>

              <button className={`${left_menu === "Goals" ? "active" : ""}`}>
              <i class="fa-solid fa-bullseye"></i>
                Goals
              </button>
            </li>
            <li onClick={() => updateMenu("Diet Plan")}>

              <button
                className={`${left_menu === "Diet Plan" ? "active" : ""}`}
              >
                Diet Plan
              </button>
            </li>
            {/* <li><button>Goals</button></li>
                <li><button>My Schedule</button></li>
                <li><button>Progress</button></li> */}
          </ul>
        </div>
        <hr />
        <div className="loggout">
          <i class="fa-solid fa-angles-left"></i>
          <Link style={{ textDecoration: "none" }} to="/loggout">
            <button>Loggout</button>{" "}
          </Link>
        </div>
      </div>
      <div className="right-menu">
        <div className="navbar">
          <div className="greeting">
            <p>Good Morning</p>
            <h2>Welcome, Der!</h2>
          </div>
          <div className="search-bar">
            <i className="fa-solid fa-magnifying-glass search-icon"></i>
            <input type="text" placeholder="Search..." />
          </div>
          <div className="info-btns">
            <ul>
              <li>
                <i
                  className="fa-solid fa-bell"
                  style={{ fontSize: "24px" }}
                ></i>
              </li>
              <li>
                <i
                  className="fa-solid fa-gear"
                  style={{ fontSize: "24px" }}
                ></i>
              </li>
              <li>
                <i
                  className="fa-solid fa-user"
                  style={{ fontSize: "24px" }}
                ></i>
              </li>
            </ul>
          </div>
          <hr />
        </div>
        <div className="menu">{selectedPage}</div>
      </div>
    </div>
  );
};

export default Homepage;
